import { observable, action } from 'mobx';
import axios from 'axios';

class CCsStore {
  @action
  getDetails() {
    axios
      .get(`https://fakerapi.it/api/v1/credit_cards?_quantity=1`)
      .then(function (response) {
        type = response.data.data[0].type;
        owner = response.data.data[0].owner;
        number = response.data.data[0].number;
        expiration = response.data.data[0].expiration;

        console.log(response.data.data[0], type, owner, number, expiration);
      })
      .catch(function (error) {
        console.log(error);
      });
  }
}

class CCStore {
  @observable type = '';
  @observable owner = '';
  @observable number = '';
  @observable expiration = '';

  constructor(title) {
    this.type = type;
    this.number = number;
    this.owner = owner;
    this.expiration = expiration;
  }
}

export default CCsStore;
